import { useState, useEffect } from "react";
import Navbar from "../components/Navbar";
import { apiGet, apiPost, apiPut, apiDelete } from "../api";

export default function Tasks() {
  const token = localStorage.getItem("token");

  const [tasks, setTasks] = useState([]);
  const [title, setTitle] = useState("");
  const [desc, setDesc] = useState("");

  async function loadTasks() {
    const data = await apiGet("/tasks", token);
    setTasks(data);
  }

  const addTask = async (e) => {
    e.preventDefault();
    await apiPost("/tasks", { title, description: desc }, token);
    setTitle("");
    setDesc("");
    loadTasks();
  };

  const toggleComplete = async (task) => {
    await apiPut(`/tasks/${task._id}`, { ...task, completed: !task.completed }, token);
    loadTasks();
  };

  const deleteTask = async (id) => {
    await apiDelete(`/tasks/${id}`, token);
    loadTasks();
  };

  useEffect(() => {
    loadTasks();
  }, []);

  return (
    <div>
      <Navbar />

      <div className="p-6 max-w-3xl mx-auto">
        <h2 className="text-3xl font-bold mb-4">Your Tasks</h2>

        {/* Add Task */}
        <form onSubmit={addTask} className="mb-6 bg-white p-4 shadow rounded">
          <input
            className="w-full p-2 border rounded mb-3"
            placeholder="Task title"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
          />
          <input
            className="w-full p-2 border rounded mb-3"
            placeholder="Task description"
            value={desc}
            onChange={(e) => setDesc(e.target.value)}
          />
          <button className="bg-green-600 text-white px-4 py-2 rounded">Add Task</button>
        </form>

        {/* Table */}
        <div className="overflow-x-auto bg-white shadow rounded">
          <table className="w-full border-collapse">
            <thead>
              <tr className="bg-gray-200 text-left">
                <th className="p-3 border">Title</th>
                <th className="p-3 border">Description</th>
                <th className="p-3 border">Status</th>
                <th className="p-3 border text-center">Actions</th>
              </tr>
            </thead>

            <tbody>
              {tasks.map((task) => (
                <tr key={task._id} className="hover:bg-gray-50">
                  <td className={`p-3 border font-semibold ${task.completed ? "line-through" : ""}`}>
                    {task.title}
                  </td>

                  <td className="p-3 border text-gray-600">{task.description}</td>

                  <td className="p-3 border">
                    {task.completed ? (
                      <span className="text-green-600 font-bold">Completed</span>
                    ) : (
                      <span className="text-red-600 font-bold">Pending</span>
                    )}
                  </td>

                  <td className="p-3 border text-center space-x-2">
                    <button
                      onClick={() => toggleComplete(task)}
                      className="px-3 py-1 bg-blue-500 text-white rounded"
                    >
                      {task.completed ? "Undo" : "Done"}
                    </button>

                    <button
                      onClick={() => deleteTask(task._id)}
                      className="px-3 py-1 bg-red-500 text-white rounded"
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}

              {tasks.length === 0 && (
                <tr>
                  <td colSpan="4" className="p-4 text-center text-gray-500">
                    No tasks found.
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
